import React from "react";
import slider from '../../assest/slider.jpg'

import 'react-awesome-slider/dist/styles.css';
const AboutUs = () => {
  return (
    <>
      <div>
      <img src={slider} style={{ objectFit: "cover", width: '100%', height: '200px' }} />

      </div>
    </>
  );
}

export default AboutUs;
